import React, { Component } from 'react'
import Layout from '../components/Layout'
import ReactHtmlParser from 'react-html-parser'

class Journal extends Component {
  constructor (props) {
    super(props)
    this.state = { journals: [] }
  }
  render () {
    return (
      <Layout title='Newtnotes | Journal'>
        <div>
          <h1>Journal</h1>

        </div>
      </Layout>
    )
  }
}

export default Journal
